import React from 'react';
import {Github} from 'react-bootstrap-icons'

const Footer = () => {
    return (
        <>
            <footer className='fixed-bottom'>
                <div>
                    &copy; 2022 Copyright: David Wong
                    <a href='https://github.com/davidwong1358' className='btn mx-3'>
                        <Github size={24}/>
                    </a>
                </div>
            </footer>
        </>
    )
}

export default Footer;
